Nach § 82 Abs. 6 NGO ist im Haushaltssicherungskonzept festzulegen:
• Innerhalb welchen Zeitraums der Haushaltsausgleich erreicht,
• wie der ausgewiesene Fehlbetrag abgebaut und
• das Entstehen eines neuen Fehlbetrages in künftigen Jahren vermieden werden soll.
Nach den Hinweisen des MI vom 30.10.2007 sind
• die Haushaltssicherungsmaßnahmen konkret und verbindlich zu beschreiben;
• der genaue Umsetzungszeitpunkt, die Umsetzungsmethode und das bezifferte
Einsparvolumen jeder Einzelmaßnahme zu benennen;
• alle Möglichkeiten der Ertragsverbesserung zu überprüfen;
• alle nicht auf Gesetz beruhenden Leistungen detailliert aufzulisten, kritisch auf ihre
Erforderlichkeit hin zu überprüfen und ggf. konsequent zu reduzieren;
• Aufwandserhöhungen im Bereich der nicht auf Gesetz beruhenden Leistungen einzeln
darzustellen und zu begründen.
